import "./App.css";

import { Route, Routes } from "react-router-dom";

//Components
import Nav from "./Components/Nav";

//Pages
import Adminpanel from "./Pages/Adminpanel";

function App() {
  return (
    <div className="App">
      <Nav />
      <Routes>
        <Route path="/" />
        <Route path="cart" />
      </Routes>
    </div>
  );
}

export default App;
